def lemonadeChange(bills):
    balance_dict = {5: 0, 10: 0, 20: 0}
    for bill in bills:
        if bill == 5:
            # balance.append(bill)
            balance_dict[bill] = balance_dict[bill] + 1
        else:
            if bill == 10:
                if balance_dict[5] >= 1:
                    balance_dict[bill] = balance_dict[bill] + 1
                    balance_dict[5] = balance_dict[5] - 1
                else:
                    return False
            else:
                if balance_dict[5] >= 1 and balance_dict[10] >= 1:
                    balance_dict[bill] = balance_dict[bill] + 1
                    balance_dict[5] = balance_dict[5] - 1
                    balance_dict[10] = balance_dict[10] - 1
                elif balance_dict[5] >= 3:
                    balance_dict[bill] = balance_dict[bill] + 1
                    balance_dict[5] = balance_dict[5] - 3
                else:
                    return False
    return True

def lemonadeChangeDiscussion(bills):
    five = ten = twenty = 0
    for bill in bills:
        if bill == 5:
            five += 1
        elif bill == 10:
            if five < 1:
                return False
            five -= 1
            ten += 1
        elif bill == 20:
            if five >= 1 and ten >= 1:
                twenty += 1
                five -= 1
                ten -= 1
            elif five >= 3:
                twenty += 1
                five -= 3
            else:
                return False
    return True

